import React from 'react';
import { Link } from 'react-router-dom';

class Home extends React.Component{
    render(){
        return (
          <div className="Home">
              Home Page

              <br/>
              <Link to={'/login'}>
                  <button>Login</button>
              </Link>
              <br/>
              <Link to={'/Main'}>
                  <button>Go to Main User's Page</button>
              </Link>
              <br/>
              <Link to={'/MainAdmin'}>
                  <button>Go to Main Admin's Page</button>
              </Link>
          </div>
        );
    }
}

export default Home;
